import styled from "styled-components";
export const ButtonElement = styled.button`
  background: #fff;
  // color:  ${props => (props.navBtn ? "#000" : "#fff")};
  border: ${props => (props.navBtn ? "none" : ".01rem solid #fff")};
  padding: .5rem;
  font-size: 1rem;
  font-weight: 600
  outline:none;
  &:hover{
    background:  ${props =>
      props.navBtn ? "#fff" : "var(--mainBrown)"};
    border:none;
  }
`;
